import React from 'react';
import ReactDOM from 'react-dom/client';
import './App.css'; // Opcional, se você tiver um arquivo de estilos chamado index.css
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);


